import React from 'react'
import fetch from 'isomorphic-unfetch'
import axios from 'axios'

const Testpage = ({pokemons = [], count}) =>(
    <div>
        <ul className="list">
          {pokemons.map(pokemons => {
            const id = getId(pokemons)
            return (
              <li key={id}>
                <span>{pokemons.results.url} </span>
                <Link href="/[id]" as={`/${id}`}>
                  <a>View More</a>
                </Link>
              </li>
            )
          })}
        </ul>
    </div>
)

Testpage.getInitialProps = async ({ req }) => {
    const rand = Math.round(Math.random() * (700 - 1) + 1);
    const initialURL = 'https://pokeapi.co/api/v2/pokemon?offset='+rand+'&limit=30';
    
    const { data, count } = await axios.get(initialURL)

   
    return {
      pokemons: data,
      count,
    }
  }
  export default Testpage
